function getAllRegisteredContractsOfType(uint256 contractType) public view returns (address[] memory) {
    uint256 contractCount = registeredContracts[contractType];
    require(contractCount > 0, "No contracts registered for this type");

    address[] memory contracts = new address[](contractCount);
    uint256 baseKey = uint256(keccak256(abi.encodePacked(contractType)));

    for (uint256 i = 0; i < contractCount; i++) {
        contracts[i] = address(uint160(uint256(registeredContracts[baseKey + i])));
    }

    return contracts;
}
